const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const formatMessage = require('format-message');

const blockIconURI = 'data:image/svg+xml;base64,';
const menuIconURI = 'data:image/svg+xml;base64,';

let audio = new Audio();
class lazyaudio {
    constructor(runtime) {
        this.runtime = runtime;
    }
    getInfo() {
        return {
            id: "lazyaudio",
            name: formatMessage({
                id: "lazyaudio.categoryName",
                default: "Lazy Audio",
                description: "Lazy Audio Extension"
            }),
            menuIconURI: menuIconURI,
            blockIconURI: blockIconURI,
            blocks: [
            {
                opcode: 'lazyPlay',
                text: formatMessage({
                    id: 'playFrom',
                    default: 'play [URL]',
                    description: 'play music from'
                }),
                blockType: BlockType.COMMAND,
                arguments: {
                    URL: {
                        type: ArgumentType.STRING,
                        defaultValue: "https://114.51.41.91:9810/Beast_Senior.mp3"
                    }
                }
            },
            {
                opcode: 'lazyPlayFrom',
                text: formatMessage({
                    id: 'lazyPlayFrom',
                    default: 'play [URL] from [START]',
                    description: 'lazyPlayFrom'
                }),
                blockType: BlockType.COMMAND,
                arguments: {
                    URL: {
                        type: ArgumentType.STRING,
                        defaultValue: "https://114.51.41.91:9810/Beast_Senior.mp3"
                    },
                    START: {
                        type: ArgumentType.NUMBER,
                        defaultValue: 0
                    }
                }
            },
             {
                opcode: 'stopLazyPlay',
                text: formatMessage({
                    id: 'stopLazyPlay',
                    default: 'stop',
                    description: 'stop music'
                }),
                blockType: BlockType.COMMAND,
            },
            {
                opcode: 'setLazyPlayVolume',
                text: formatMessage({
                    id: 'setLazyPlayVolume',
                    default: 'set volume to [VALUE]',
                    description: 'set volume'
                }),
                blockType: BlockType.COMMAND,
                arguments: {
                    VALUE: {
                        type: ArgumentType.NUMBER,
                        defaultValue: 100
                    }
                }
            }]
        }
    }
    
    lazyPlay(args){
       audio = new Audio(args.URL);
       audio.play();
    }
    
    stopLazyPlay(args){
       audio.pause();
       audio.currentTime = 0;
    }
    
    setLazyPlayVolume(args){
       audio.volume = args.VALUE/100;
    }
    
    lazyPlayFrom(args){
       audio = new Audio(args.URL);
       audio.currentTime = args.START;
       audio.play();
    }
}

module.exports = lazyaudio;
